USE graduate_db;

DROP TABLE IF EXISTS debtors_organisations;
CREATE TABLE debtors_organisations(
	id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
	short_name VARCHAR(100) NOT NULL,
	long_name VARCHAR(200) NOT NULL,
	adress_of_debtor VARCHAR(300) NOT NULL,
	phone_of_debtor VARCHAR(20) NOT NULL,
	region_of_debtor INT UNSIGNED NOT NULL,
	type_of_debtor INT UNSIGNED NOT NULL,
	individual_tax_number VARCHAR(20) NOT NULL,
	individual_registration_number VARCHAR(20) NOT NULL,
	classifier_number VARCHAR(20) NOT NULL,
	type_of_organisation_form INT UNSIGNED NOT NULL
);
UPDATE debtors_organisations SET individual_tax_number = 
	CONCAT(
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10),
		FLOOR(0 + RAND() * 10)
	);
